  array('id' => '123','term_id' => '66','key' => 'content','value' => '{"content":"apple MacBook Air 13.3-Inch 10th Gen Core i3-1.1GHz, 8GB RAM, 256GB SSD (MWTL2) Gold 2020\\r\\nThe extremely thin and light MacBook Air is now stronger and better than ever. It has an eye-catching Retina display, a new and elegant keyboard, Touch ID, a processor with up to double performance, faster image processing, and double storage capacity. The sleek design of the wedge-shaped side is made of 100% recycled aluminum metal, making it the most environmentally friendly Mac ever.The 2560 x 1600 resolution brings over 4 million pixels, and the results are naturally stunning. The original color technology can automatically adjust the white point of the display to match the color temperature of your environment, so that the web pages and emails you see are as natural as printed products. Thousands of colors are displayed to make everything you see rich and vivid. The display glass extends to the edge of the fuselage, allowing you to focus on the screen content and love what you see. The MacBook Air weighs as little as 1.29 kg, but the inner performance is sufficient to complete the heavy work. The currently available Intel Core i3 1.1GHz dual-core, Turbo Boost up to 3.2GHz, with 4MB L3 cache memory processing faster performance, giving you a powerful boost, whether browsing the web, playing games, or even editing videos, also easy to handle. And equipped with up to 8GB high-performance memory, even if you run multiple apps at the same time, you can still work smoothly and freely.","excerpt":"apple MacBook Air 13.3-Inch 10th Gen Core i3-1.1GHz, 8GB RAM, 256GB SSD (MWTL2) Gold 2020\\r\\nThe extremely thin and light MacBook Air is now stronger and better than ever. It has an eye-catching Retina display, a new and elegant keyboard, Touch ID, a processor with up to double performance, faster image processing, and double storage capacity. The sleek design of the wedge-shaped side is made of 100% recycled aluminum metal, making it the most environmentally friendly Mac ever.The 2560 x 1600 resolution brings over 4 million pixels, and the results are naturally stunning."}'),
