  array('id' => '125','term_id' => '67','key' => 'content','value' => '{"content":"Apple Macbook Air 13.3 inch Core i5, 8GB Ram, 128GB SSD (MVFH2) Space Gray (2019)\\r\\nApple Macbook Air (MVFH2) is built in 13.3-inch (diagonal) LED-backlit display with IPS technology; 2560-by-1600 native resolution at 227 pixels per inch with support for millions of colors with True Tone technology. This exclusive Macbook air has Integrated Touch ID sensor which make it more uniqe. Here used Intel Core i5 1.6GHz dual-core, Turbo Boost up to 3.6GHz, with 4MB L3 cache processor, 8GB Ram with 128GB SSD and Intel UHD Graphics 617. The MVFH2 Macbook Air imultaneously supports full native resolution on the built-in display at millions of colors One external display with 5120-by-2880 resolution at up to 60Hz, Up to two external displays with 4096-by-2304 resolution at up to 60Hz. There are Two Thunderbolt 3 (USB-C) ports with support for - Charging, DisplayPort, Thunderbolt (up to 40 Gb\\/s) and USB-C 3.1 Gen 2 (up to 10 Gb\\/s). The integrated Touch ID sensor allows you to unlock your MacBook Air with your fingerprint and authenticate your identity and also make secure online purchases with Apple Pay. Paired with the Apple T2 security chip, the T2\'s Security Enclave protects your Touch ID information and also ensures that software loaded during the boot process has not been tampered with. The T2 also features an SSD controller with on-the-fly data encryption for everything stored on the SSD for a secure boot process. Here used 78 (U.S.) or 79 (ISO) individual LED-backlit keys, including 12 function keys and 4 arrow keys with Ambient light sensor and Force Touch trackpad for precise cursor control and pressure-sensing capabilities; enables Force clicks, accelerators, pressure-sensitive drawing, and Multi-Touch gestures.Connect to the internet via802.11ac Wi-Fi wireless networking; IEEE 802.11a\\/b\\/g\\/n compatible and use Bluetooth 4.2 to connect wirelessly to compatible peripherals and accessories. The dual Thunderbolt 3 ports provide high bandwidth of up to 40 Gb\\/s and the versatility of USB-C 3.1 Gen 2 (up to 10 Gb\\/s). This exclusive Apple Macbook Air (MVFH2) comes with 01 year International Limited Warranty (Terms & Condition Apply As Per Apple)","excerpt":"Apple Macbook Air 13.3 inch Core i5, 8GB Ram, 128GB SSD (MVFH2) Space Gray (2019)\\r\\nApple Macbook Air (MVFH2) is built in 13.3-inch (diagonal) LED-backlit display with IPS technology; 2560-by-1600 native resolution at 227 pixels per inch with support for millions of colors with True Tone technology. This exclusive Macbook air has Integrated Touch ID sensor which make it more uniqe."}'),
