eGPU Enclosure. With a simple plug in and play system involving Thunderbolt 3 you can get fast performance as quickly as plugging in a cable. Gain incredibly fast transfer speeds of 40Gbps giving your light laptop system the revved up power of a full desktop GPU. Designed in the same Razer style you see from other products across the board the Razer Core X Chroma sits on your desk discreetly with other Razer products giving your setup one whole unified look."}'),
