  array('id' => '133','term_id' => '71','key' => 'content','value' => '{"content":"c The photos you take with the D3500 capture more than the moment\\u2014they capture the feeling of the moment, a feeling that can be shared immediately with your friends and family and then relived for a lifetime. If you can take a picture with your smartphone, you can take a great picture with the D3500. Auto Mode delivers amazing results in nearly any situation. If you want to learn while you shoot, turn on Guide Mode and follow simple on-screen guidance. The D3500 is fast, responsive and simple to use. You won\'t be stuck fussing with camera controls while a great moment passes you by. Just point, shoot and share amazing photo after photo. The D3500 simply feels great in your hands. It\'s lightweight and balanced, even with a telephoto lens attached. Each button and dial is carefully placed for comfort and ease of use, and the menu system is simple and intuitive","excerpt":"Nikon D3500 DSLR Camera With 18-55mm Lens\\r\\nYou don\'t need to be a photographer to know a great photo when you see one. And you don\'t need to be a photographer to take a great photo\\u2014you just need the D3500. It\'s as easy to use as a point-and-shoot, but it takes beautiful DSLR photos and videos that get noticed. It feels outstanding in your hands, sturdy and balanced with controls where you want them. It\'s compact, durable and versatile, ideal for travel."}'),
