  array('id' => '135','term_id' => '72','key' => 'content','value' => '{"content":"Sony PlayStation 5 Gaming Console\\r\\nSony PlayStation 5 Gaming Console comes with an ultra-high speed SSD, deeper immersion which is support for haptic feedback, adaptive triggers and 3D Audio , and an all-new generation of incredible PlayStation games. The exclusive PS5 is a technically impressive piece of hardware. There\'s the new, 10.28 TFLOPs, 36 CUs at 2.23GHz GPU, Custom RDNA 2 GPU architecture that can push 4K resolution at 120 frames per second, and the octa-core AMD Zen 2-based CPU with a 3.5GHz clock speed. It is also featured with 16GB of GDDR6 \\/ 256-bit memory and Custom 825GB SSD. Here, The custom integration of the PS5 console\'s systems lets creators pull data from the SSD so quickly that they can design games in ways never before possible. The PS 5 Marvel at incredible graphics and experience new PS5 features, these are - Ray tracing, that provides you a new level of realism as rays of light are individually simulated, creating true-to-life shadows and reflections in supported PS5 games; 4K-TV gaming and also PS5 console is compatible with 8K displays through HDMI 2.1 support. . The PlayStation 5 comes with smooth and fluid high frame rate gameplay at up to 120fps for compatible games, that support for 120Hz output on 4K displays. Here, the HDR technology supported PS5 games display an unbelievably vibrant and lifelike range of colors. Y&ou will enjoy faster and smoother frame rates in select PS4 and PS VR games. This latest PlayStation 5 gives gamers the ability to let players upgrade their disc and digital PS4 games to digital PS5 games. This PlayStation has VR integration. It will provides you Breathtaking immersion to Discover a deeper gaming experience with support for haptic feedback, adaptive triggers and 3D Audio technology and also you will enjoy live and truly experience with Tempest 3D AudioTech. In this, Sony PlayStation 5 The DualSense wireless controller for PS5 offers immersive haptic feedback, dynamic adaptive triggers and a built-in microphone, all integrated into an iconic design.","excerpt":"Sony PlayStation 5 Gaming Console\\r\\nSony PlayStation 5 Gaming Console comes with an ultra-high speed SSD, deeper immersion which is support for haptic feedback, adaptive triggers and 3D Audio , and an all-new generation of incredible PlayStation games. The exclusive PS5 is a technically impressive piece of hardware. There\'s the new, 10.28 TFLOPs, 36 CUs at 2.23GHz GPU, Custom RDNA 2 GPU architecture that can push 4K resolution at 120 frames per second, and the octa-core AMD Zen 2-based CPU with a 3.5GHz clock speed. It is also featured with 16GB of GDDR6 \\/ 256-bit memory and Custom 825GB SSD. Here, The custom integration of the PS5 console\'s systems lets creators pull data from the SSD so quickly that they can design games in ways never before possible."}'),
