  array('id' => '137','term_id' => '73','key' => 'content','value' => '{"content":"Xbox Night Ops Camo Special Edition Wireless Controller\\r\\nLock and load with the Xbox Wireless Controller \\u2013 Night Ops Camo Special Edition, the first in a new series of controllers, featuring a rugged black, grey, and metallic gold camouflage pattern. An etched trigger grip gives you extra control, and button mapping allows you to customize your gear just the way you like it. Plug in any compatible headset with the 3.5mm stereo headset jack, and with Bluetooth technology, play your favorite games on Windows 10 PCs, laptops, and mobile devices. Experience the enhanced comfort and feel of the new Xbox Wireless Controller, featuring a etched trigger grip, precise thumbsticks, and a responsive D-pad. Feel the action with Impulse Triggers and enjoy custom button mapping. Plus, plug in any compatible headset with the 3.5mm stereo headset jack. Play your favorite games on Windows 10 PCs, laptops, and mobile devices. Button mapping available via Xbox Accessories app for Xbox One and Windows 10. Operating system and controller firmware updates may be required. Compatible with Xbox Series X, Xbox Series S, Xbox One X, Xbox One S, Xbox One, Windows 10, Android, iOS. Functionality depends on the supported device and operating system version, and experiences may vary. The Xbox Night Ops Camo Controller has no warranty.","excerpt":"Xbox Night Ops Camo Special Edition Wireless Controller\\r\\nLock and load with the Xbox Wireless Controller \\u2013 Night Ops Camo Special Edition, the first in a new series of controllers, featuring a rugged black, grey, and metallic gold camouflage pattern. An etched trigger grip gives you extra control, and button mapping allows you to customize your gear just the way you like it."}'),
