  array('id' => '139','term_id' => '74','key' => 'content','value' => '{"content":"Asus RT-AC1200 V2 Dual-Band Wifi Wireless Router\\r\\nThe RT-AC1200 V2 being powered by 5th generation Wi-Fi (5G Wi-Fi), the 802.11ac chipset provides the faster wireless speeds than N technology. At 2.4 GHz, it reaches 300 Mbps, while on the 5GHz band it blazes to 867 Mbps. The upgraded bandwidth has the higher capacity you need to increase Wi-Fi enjoyment at home. With notebooks, desktops, pads, and smartphones now all Wi-Fi-reliant, it\\u2019s time to upgrade to the next generation to expand you connectivity now and in the future. Delivering both 2.4 GHz and 5 GHz concurrent bands up to 300Mbps and 867Mbps respectively, the RT-AC1200 V2 has a total speed of up to 1167Mbps connectivity to provide speed with stability. Use smartphone, tablet, or PC to effortlessly set up the ASUS router in less than 30 seconds\\u00b9 and in only 3 easy steps. With the ASUSWRT dashboard UI, setup, monitor, and control network applications all in one intuitive area. On top of 30-second setup, multi-device detection, and flexible settings that make the most of your network performance. Dual WAN enables having two connections\\/ISPs on one router, with load balance and failover mode for added stability and redundancy to ensure uninterrupted internet access. This exclusive RT-AC1200 V2 comes with 02 years of warranty","excerpt":"Asus RT-AC1200 V2 Dual-Band Wifi Wireless Router\\r\\nThe RT-AC1200 V2 being powered by 5th generation Wi-Fi (5G Wi-Fi), the 802.11ac chipset provides the faster wireless speeds than N technology. At 2.4 GHz, it reaches 300 Mbps, while on the 5GHz band it blazes to 867 Mbps. The upgraded bandwidth has the higher capacity you need to increase Wi-Fi enjoyment at home."}'),
  array('id' => '140','term_id' => '74','key' => 'seo','value' => '{"meta_title":"Asus RT-AC1200 V2 Dual-Band Wifi Wireless Router","meta_description":"","meta_keyword":""}'),
